const baseUrl = preliveBaseUrl;

function makeGetRequest(apiUrl: string, cookie: { [name: string]: string }) {
    const url = `${baseUrl}api/${apiUrl}`;
    // console.log(`URL: ${url}`);
    http.get(url, { cookies: cookie });
}

function postData(url: string, body: object, cookie: { [name: string]: string }) {
    const firstResponse = http.get(
        baseUrl,
        {
            cookies: cookie
        });

    const xsrfToken = firstResponse.headers["Set-Cookie"]
                            .replace(/httponly, /g, "")
                            .split("; ")
                            .map(x => x.split("="))
                            .find(x => x[0] === "XSRF-TOKEN")?.[1];

    http.post(
        url,
        JSON.stringify(body),
        {
            headers: {
                "X-XSRF-TOKEN": xsrfToken || "",
                "Content-Type": "application/json"
            },
            cookies: {
                ...cookie,
                "XSRF-TOKEN": xsrfToken || ""
            }
        });

    makeGetRequest("partiallyMatchedEmployee", cookie);
    makeGetRequest("appointment", cookie);
    makeGetRequest("profile", cookie);
    makeGetRequest("customer", cookie);
    makeGetRequest("adminuser", cookie);
    makeGetRequest("taskCategories", cookie);
    makeGetRequest("customer/fd7f7b8c-135b-4acd-92e2-36245147f13b/workGroup", cookie);
}

